import React from "react";


const SubTextBox = ({subheading, heading, para, imgsrc, bg}) =>{
    return(
        <>
            <div className="col-lg-6 col-md-12 SubTextBox-1" style={bg}>
            <h4>{subheading}</h4>
            <h3>{heading}</h3>
            <p>{para}</p>
            
            </div>
            <div className="col-lg-6 col-md-12 SubTextBox-2">
            <div className="textBox-img">
                <img src={imgsrc} alt="tractor" className="textboxImg-1" />
            </div>
            
            </div>
        </>

    )
}

export default SubTextBox;
